// TYPE (3,1) GEOMETRY

void geom_check31()
{
    if(nH != 6 || nL != 2)
    {
        printf("Error: geometry is not (3,1)\n");
        exit(EXIT_FAILURE);
    }
}

// build gamma matrices
void init_gamma31()
{
    
    for(int i=0; i<nH; i++)
        gammaH[i] = gsl_matrix_complex_calloc(dimG, dimG);
    for(int i=0; i<nL; i++)
        gammaL[i] = gsl_matrix_complex_calloc(dimG, dimG);

    // gammaH0
    gsl_matrix_complex_set(gammaH[0], 0, 0, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[0], 1, 1, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[0], 2, 2, gsl_complex_rect(-1.0, 0.0));
    gsl_matrix_complex_set(gammaH[0], 3, 3, gsl_complex_rect(-1.0, 0.0));
 
    // gammaH1
    gsl_matrix_complex_set(gammaH[1], 0, 2, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[1], 1, 3, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[1], 2, 0, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[1], 3, 1, gsl_complex_rect(1.0, 0.0));
 
    // gammaH2
    gsl_matrix_complex_set(gammaH[2], 0, 2, gsl_complex_rect(0.0, 1.0));
    gsl_matrix_complex_set(gammaH[2], 1, 3, gsl_complex_rect(-0.0, -1.0));
    gsl_matrix_complex_set(gammaH[2], 2, 0, gsl_complex_rect(0.0, -1.0));
    gsl_matrix_complex_set(gammaH[2], 3, 1, gsl_complex_rect(0.0, 1.0));
 
    // gammaH3
    gsl_matrix_complex_set(gammaH[3], 0, 1, gsl_complex_rect(0.0, -1.0));
    gsl_matrix_complex_set(gammaH[3], 1, 0, gsl_complex_rect(0.0, 1.0));
    gsl_matrix_complex_set(gammaH[3], 2, 3, gsl_complex_rect(0.0, -1.0));
    gsl_matrix_complex_set(gammaH[3], 3, 2, gsl_complex_rect(0.0, 1.0));
 
    // gammaH4
    gsl_matrix_complex_set(gammaH[4], 0, 1, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[4], 1, 0, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[4], 2, 3, gsl_complex_rect(-1.0, 0.0));
    gsl_matrix_complex_set(gammaH[4], 3, 2, gsl_complex_rect(-1.0, 0.0));
 
    // gammaH5
    gsl_matrix_complex_set(gammaH[5], 0, 3, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[5], 1, 2, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[5], 2, 1, gsl_complex_rect(1.0, 0.0));
    gsl_matrix_complex_set(gammaH[5], 3, 0, gsl_complex_rect(1.0, 0.0));
 
    // gammaL0
    gsl_matrix_complex_set(gammaL[0], 0, 3, gsl_complex_rect(0.0, 1.0));
    gsl_matrix_complex_set(gammaL[0], 1, 2, gsl_complex_rect(-0.0, -1.0));
    gsl_matrix_complex_set(gammaL[0], 2, 1, gsl_complex_rect(0.0, -1.0));
    gsl_matrix_complex_set(gammaL[0], 3, 0, gsl_complex_rect(0.0, 1.0));
 
    // gammaL1
    gsl_matrix_complex_set(gammaL[1], 0, 0, gsl_complex_rect(0.0, -1.0));
    gsl_matrix_complex_set(gammaL[1], 1, 1, gsl_complex_rect(0.0, 1.0));
    gsl_matrix_complex_set(gammaL[1], 2, 2, gsl_complex_rect(0.0, -1.0));
    gsl_matrix_complex_set(gammaL[1], 3, 3, gsl_complex_rect(0.0, 1.0));
}


void actionD2t31(double* vecS, int* control)
{
    gsl_matrix_complex* H0 = H[0];
    gsl_complex trH0 = trace(H0);
    gsl_matrix_complex* H1 = H[1];
    gsl_complex trH1 = trace(H1);
    gsl_matrix_complex* H2 = H[2];
    gsl_complex trH2 = trace(H2);
    gsl_matrix_complex* H3 = H[3];
    gsl_complex trH3 = trace(H3);
    gsl_matrix_complex* H4 = H[4];
    gsl_complex trH4 = trace(H4);
    gsl_matrix_complex* H5 = H[5];
    gsl_complex trH5 = trace(H5);
    gsl_matrix_complex* L0 = L[0];
    gsl_matrix_complex* L1 = L[1];
    gsl_matrix_complex* H1H1 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, H1, H1, GSL_COMPLEX_ZERO, H1H1);
    gsl_complex trH1H1 = trace(H1H1);
    gsl_matrix_complex* L1L1 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, L1, L1, GSL_COMPLEX_ZERO, L1L1);
    gsl_complex trL1L1 = trace(L1L1);
    gsl_matrix_complex* L0L0 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, L0, L0, GSL_COMPLEX_ZERO, L0L0);
    gsl_complex trL0L0 = trace(L0L0);
    gsl_matrix_complex* H5H5 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, H5, H5, GSL_COMPLEX_ZERO, H5H5);
    gsl_complex trH5H5 = trace(H5H5);
    gsl_matrix_complex* H4H4 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, H4, H4, GSL_COMPLEX_ZERO, H4H4);
    gsl_complex trH4H4 = trace(H4H4);
    gsl_matrix_complex* H0H0 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, H0, H0, GSL_COMPLEX_ZERO, H0H0);
    gsl_complex trH0H0 = trace(H0H0);
    gsl_matrix_complex* H2H2 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, H2, H2, GSL_COMPLEX_ZERO, H2H2);
    gsl_complex trH2H2 = trace(H2H2);
    gsl_matrix_complex* H3H3 = gsl_matrix_complex_calloc(dim, dim);
    gsl_blas_zhemm(CblasLeft, CblasUpper, GSL_COMPLEX_ONE, H3, H3, GSL_COMPLEX_ZERO, H3H3);
    gsl_complex trH3H3 = trace(H3H3);
    gsl_matrix_complex_free(H1H1);
    gsl_matrix_complex_free(L1L1);
    gsl_matrix_complex_free(L0L0);
    gsl_matrix_complex_free(H5H5);
    gsl_matrix_complex_free(H4H4);
    gsl_matrix_complex_free(H0H0);
    gsl_matrix_complex_free(H2H2);
    gsl_matrix_complex_free(H3H3);
    if(control[0])
    vecS[0] = +8*dim*GSL_REAL(trL1L1)+8*GSL_REAL(gsl_complex_mul(trH1,trH1))+8*GSL_REAL(gsl_complex_mul(trH0,trH0))+8*dim*GSL_REAL(trH0H0)+8*GSL_REAL(gsl_complex_mul(trH2,trH2))+8*dim*GSL_REAL(trH4H4)+8*GSL_REAL(gsl_complex_mul(trH5,trH5))+8*dim*GSL_REAL(trH5H5)+8*dim*GSL_REAL(trH3H3)+8*dim*GSL_REAL(trH1H1)+8*GSL_REAL(gsl_complex_mul(trH3,trH3))+8*GSL_REAL(gsl_complex_mul(trH4,trH4))+8*dim*GSL_REAL(trL0L0)+8*dim*GSL_REAL(trH2H2);
    if(control[1])
    vecS[1] = +8*dim*GSL_IMAG(trL1L1)+8*GSL_IMAG(gsl_complex_mul(trH1,trH1))+8*GSL_IMAG(gsl_complex_mul(trH0,trH0))+8*dim*GSL_IMAG(trH0H0)+8*GSL_IMAG(gsl_complex_mul(trH2,trH2))+8*dim*GSL_IMAG(trH4H4)+8*GSL_IMAG(gsl_complex_mul(trH5,trH5))+8*dim*GSL_IMAG(trH5H5)+8*dim*GSL_IMAG(trH3H3)+8*dim*GSL_IMAG(trH1H1)+8*GSL_IMAG(gsl_complex_mul(trH3,trH3))+8*GSL_IMAG(gsl_complex_mul(trH4,trH4))+8*dim*GSL_IMAG(trL0L0)+8*dim*GSL_IMAG(trH2H2);
    if(control[2])
    vecS[2] = GSL_REAL(trH0);
    if(control[3])
    vecS[3] = GSL_REAL(trH0H0);
    if(control[4])
    vecS[4] = GSL_REAL(trH1);
    if(control[5])
    vecS[5] = GSL_REAL(trH1H1);
    if(control[6])
    vecS[4] = GSL_REAL(trH2);
    if(control[7])
    vecS[7] = GSL_REAL(trH2H2);
    if(control[8])
    vecS[8] = GSL_REAL(trH3);
    if(control[9])
    vecS[9] = GSL_REAL(trH3H3);
    if(control[10])
    vecS[10] = GSL_REAL(trH4);
    if(control[11])
    vecS[11] = GSL_REAL(trH4H4);
    if(control[12])
    vecS[12] = GSL_REAL(trH5);
    if(control[13])
    vecS[13] = GSL_REAL(trH5H5);
}

